import React, { Component } from 'react'

export class CardDetails extends Component {

  // Constructor
	constructor(props) {
		super(props);

		this.state = {
			items: [],
			DataisLoaded: false
		};
	}

	// ComponentDidMount is used to
	// execute the code
	componentDidMount() {
		fetch("http://139.59.63.178:5454/api/customer/getallpublishedevents?Date=31-12-2021", {
      method: 'get',
      headers: {
        'Authorization': 'SEdRYnN6ZFFFRjpuc0oySXQ0NWt5',
        'AppVersion': '1.0.0',
        'AuthToken': 'bd8382d5-3adf-11eb-9263-b62d5e046812',
        'Accept-Encoding': 'gzip, deflate, br',
      }
    })
			.then((res) => res.json())
			.then((json) => {
				this.setState({
					items: json,
					DataisLoaded: true
				});
			})
	}


	render() {
		const { DataisLoaded, items } = this.state;
		if (!DataisLoaded) return <div>
			<h1> Please wait some time.... </h1> </div> ;

		console.log(items);

		let eventItems = [];
		for(var i=0;i<items.event.length;i++)
		{ 
			eventItems.push(<div className="card">
				<div className="card-body">
					<h5 className="card-title">{items.Details.EventName}</h5>
					<button type="button" className="btn btn-primary">Book</button>
				</div>
			</div>
		);
		}

		return (
		<div className = "App">
			<h1> Fetch data from an api in react </h1> {
				/*items.map((item) => (
				  <div>
					  User_Name: { items.item.name },
					</div>
				))*/

			}
			<button type="button" className="btn btn-primary">Primary</button>
		</div>
	);
}
}

